import React from 'react'
import Homeslide from './homeslide'
import Jewellery from './jewellery'
import Homecollection from './collection'


export default function Home() {
  return (
    <div>
       <Homeslide/>
       <Jewellery/>
       <Homecollection/>
    </div>
  )
}
